import Listbox from "../../../components/listbox/Listbox"

const NetworkMenu = () => {

  const people = [
    { name: 'Wade Cooper' },
    { name: 'Arlene Mccoy' },
    { name: 'Devon Webb' },
    { name: 'Tom Cook' },
    { name: 'Tanya Fox' },
    { name: 'Hellen Schmidt' },
  ]

  return (
    <Listbox items={people} />
  )
}

export default NetworkMenu
